import './Client.css';
export default function Navbar()
{
    return (
        <ul className = 'navbar'>
            <li className = 'nav'>About us</li> 
            <li className = 'nav'>Contact</li>
            <li className = 'nav'>Login</li>
            <li className = 'nav'>Signup</li> 
        </ul>
    );
}
